  "id_str" : "96509612588675072",
  "text" : "#槇原敬之 まず、曲自体の歌詞から読み取れるのは、自分の一人称が「僕」であること。これは、素直に取れば男性を表すけど、しかし例えば自分を男と認識している女性ともとれる。 [n]",
