  "id_str" : "96178037409853440",
  "text" : "ほんとならいつもならブログを使うんだけど、サーバー止めてる上にこのパソコンからブログみたいな長文書く気力が起きないのでハッシュタグ #槇原敬之 をつけてついったーに投げてみました。 [n]",
