  "id_str" : "96172479218847745",
  "text" : "#槇原敬之 一番良い曲だと思ったのは『風邪は名前を名乗らずに』でした。「風」が何の隠喩なのか、解釈が色々できそうで、(LIFE側の）マッキーの曲の中でもかなりの良曲だと思います。 [n]",
