  "text" : "#槇原敬之 『Hear to Heart』のアルバム全体的な感想としては、あんまり統一感はないのかなという感じでした。まぁ、色んな曲が詰まってると言い換えれば、いろんな人に届くアルバムなのかなという気もします。 [n]",
