  "id_str" : "94675874963664896",
  "text" : "ふむ。ダ・ヴィンチの連続式は、流量一定だけでなく、この時点で既に（数式で書かれてなくても）流速×断面積という概念を含んでたのかー。それを再発見したのはカステリ。で、それをダランベールとオイラーが、って流れか。じゃあ積分形の連続式はダ・ヴィンチが発見者かなー。",
