  "text" : "しかし、セミナーも展示もポスターも、物理計算は基本的に全部、格子法（オイラー法）ばかりで、粒子法（ラグランジュ法）ないなー。ポスターのとこに1つ格子ボルツマン法あったけど。やっぱり載せるの難しいんだろうか。 #GTCJapan",
