  "id_str" : "89517935093219328",
  "text" : "まぁネタはともかく、全部ない状態にできるなら、作らないことにするのも容易なはず。 QT @aokomoriuta 「全ての「存命人物の伝記」記事を生まれる前に消し去りたい！全てのウィキペディア日本語版の、過去と未来の全てのBLP記事を、この手で！」  #jawp",
