  "geo" : {
  },
  "id_str" : "89517499678326785",
  "text" : "「全ての「存命人物の伝記」記事を生まれる前に消し去りたい！全てのウィキペディア日本語版の、過去と未来の全てのBLP記事を、この手で！」  #jawp",
