  "geo" : {
  },
  "id_str" : "89514791420432384",
  "text" : "もちろん原理的には、ちゃんと「信頼できる情報源だけにのっとって書く」ことが出来れば、BLPだってなんだって、大抵はそう問題にならない。けど、それが出来てない記事が多すぎるし、BLPの場合、いわゆるファンとかアンチとかが自分主観で編集してしまうし。 #jawp",
  "id" : 89514791420432384,
