  "text" : "存命人物の伝記とか、正直なところウィキペディアにもたらす益より害の方が大きいと思ってる。「人類の知の総和」への貢献度の割に、ものすごい大変な問題をあまりにも多く引き連れてくる。いっそのこと「原則、亡くなってyy年経過した人のみ」ってしたい。 #jawp",
